import React, { useEffect, useState } from 'react';


const RegistrationPage = () => {

  const [ime, setIme] = useState('');
  const [prezime, setPrezime] = useState('');
  const [adresa, setAdresa] = useState('');
  const [grad, setGrad] = useState('');
  const [drzava, setDrzava] = useState('');
  const [brojtelefona, setBrojTel] = useState('');
  const [email, setEmail] = useState('');
  const [lozinka, setLozinka] = useState('');
  const [id, setID] = useState('');
  const [error, setError] = useState('');
  
  
  useEffect (()=>{
    const mail = localStorage.getItem('user_email')
    if (mail.trim().toLowerCase()!=="empty"){
      console.log(mail)
      window.location.href = '/userhome'
    }
    
  },[]
  )

  const handleRequest = (event) => {
    
    event.preventDefault();
    
    fetch('http://localhost:5000/registracija', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ ime, prezime, adresa, grad, drzava, brojtelefona, email, lozinka, id}), 
    })
    .then((res) => res.json())
      .then((data) => {
        if (data.success) {
          localStorage.setItem('user_email', JSON.stringify(data.email));
          window.location.href = '/userhome'
        } else {
          setError(true);
          console.log(data.poruka)
        }
      }) 
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div>
      <h1 >Registracija novog korisnika</h1>
      <form onSubmit = {handleRequest}>
      <div>
      <label>Ime:
      <input type="text" value={ime} onChange={(e) => setIme(e.target.value)} />
      </label>
      </div>
      <div>
      <label>Prezime:
      <input type="text" value={prezime} onChange={(e) => setPrezime(e.target.value)} />
      </label>
      </div>
      <div>
      <label >Adresa:
      <input type="text" value={adresa} onChange={(e) => setAdresa(e.target.value)} />
      </label>
      </div>
      <div>
      <label >Grad:
      <input type="text"  value={grad} onChange={(e) => setGrad(e.target.value)} /> 
      </label>
      </div>
      <div>
      <label >Država:
      <input type="text"  value={drzava} onChange={(e) => setDrzava(e.target.value)} />
      </label>
      </div>
      <div>
      <label >Broj telefona:
      <input type="text"  value={brojtelefona} onChange={(e) => setBrojTel(e.target.value)} />
      </label>
      </div>
      <div>
      <label >Email:
      <input type="text"  value={email} onChange={(e) => setEmail(e.target.value)} />
      </label>
      </div>
      <div>
      <label >Lozinka:
      <input type="password"  value={lozinka} onChange={(e) => setLozinka(e.target.value)} />
      </label>
      </div>
      <div>
      <label >ID:
      <input type="number"  value={id} onChange={(e) => setID(e.target.value)} />
      </label>
      </div>
      <button type="submit">Registruj se</button>
      </form>
  </div>   
  );
};

export default RegistrationPage;
